INSERT INTO spree_products VALUES(25,'Shibaritraining 19.11.2023 18:00 Uhr',replace(replace('<p>18:00 - 19:30 Uhr: Grund- &amp; Mittelstufe</p>\r\n\r\n<p>Das Wissen wird &auml;hnlich wie in einem Kampfsportverein vermittelt. Es gibt mehrere Stufen (Kyu) die mit der Zeit erreicht werden k&ouml;nnen. Dem japanischen Vorbild folgend, werden zun&auml;chst Grundlagen vermittelt, beispielsweise Einhand-Fesselung, Zweihand- Fesselungen, etc. Danach folgen darauf aufbauende komplexere Fesselungen. Teilnehmende lernen in ihrem eigenen Tempo. Dabei wird nicht nur auf die Technik geachtet, sondern auch auf die Haltung. Das K&ouml;nnen spiegelt sich also nicht nur im theoretischen Verstehen sondern auch in der praktischen Anwendung wieder. Erst wenn eine Technik intensiv verinnerlicht wurde, wird zum n&auml;chsten Schritt &uuml;bergeleitet. Der Unterricht im Dojo unterscheidet sich dadurch von Workshop Konzepten.</p>\r\n\r\n<p>Ziel ist es, &uuml;ber Regelm&auml;&szlig;igkeit und konstante Wiederholungen eine Routine im Fesseln zu erreichen, die es erlaubt den Partner schnell, effizient und mit gr&ouml;&szlig;tm&ouml;glicher Sicherheit einzufangen.</p>\r\n','\r',char(13)),'\n',char(10)),'2023-11-16 00:00:00','2024-01-26 11:55:23.568410','19-11-2023',NULL,NULL,NULL,1,'2023-11-16 17:43:24.113966','2024-01-26 11:55:23.674830',1,NULL,NULL,NULL,'2023-11-19 18:00:00',NULL,NULL);
