INSERT INTO spree_pages VALUES(8,'Level und Prüfungen',replace(replace('<p>Level und Pr&uuml;fungen werden aktuell in den Lehrinhalten erw&auml;hnt.</p>\r\n\r\n<p>&nbsp;</p>\r\n','\r',char(13)),'\n',char(10)),'/level-und-pruefungen','2023-08-31 15:46:55.607041','2024-02-03 12:43:04.066455',0,0,NULL,4,1,NULL,NULL,NULL,0,NULL,0,0);
INSERT INTO spree_pages VALUES(9,'Sicherheit und Risiken',replace(replace('<h2>Sicherheit</h2>\r\n\r\n<hr />\r\n<p>Shibari kann physische und emotionale Risiken mit sich bringen, insbesondere wenn es falsch durchgef&uuml;hrt wird oder wenn die Beteiligten keine Erfahrung haben. Es ist daher von gr&ouml;&szlig;ter Bedeutung, dass Sicherheitsprotokolle und -techniken beachtet werden, um Verletzungen oder Sch&auml;den zu vermeiden und die entsprechenden Risiken zu beherrschen und zu minimieren.</p>\r\n\r\n<p>Die Sicherheitsma&szlig;nahmen beim Shibari sind von entscheidender Bedeutung, um die Sicherheit und das Wohlbefinden aller Beteiligten zu gew&auml;hrleisten. Dazu geh&ouml;ren:</p>\r\n\r\n<p><strong>Geeignete&nbsp;Seile und Sicherheitsausr&uuml;stung:</strong><br />\r\nDer Einsatz&nbsp;von hochwertigen und f&uuml;r Shibari geeigneten Seilen ist entscheidend. Mindere Qualit&auml;t oder ungeeignete Materialien k&ouml;nnen Verletzungen oder andere Gefahren hervorrufen.&nbsp;Eine wichtige Vorsichtsmassnahme ist, eine gut erreichbare Sicherheitsschere oder ein Sicherheitsmesser, um Seile im Notfall schnell durchschneiden zu koennen.</p>\r\n\r\n<p><strong>Kenntnis und Verwendung spezieller Knoten und Techniken:</strong><br />\r\nDie fesselnde Person sollte die Fertigkeiten und Techniken des Shibari beherrschen und die F&auml;higkeiten der gefesselten Person ber&uuml;cksichtigen. Je nach Fertigkeiten, F&auml;higkeiten, Erfahrung und Tagesform aller Beteiligten sollte die Aktivit&auml;t entsprechend angepasst werden.<br />\r\nShibari erfordert spezielle Knoten und Varianten der Seilplatzierung, die dazu dienen, das Risiko von Verletzungen zu minimieren. Das Erlernen und korrekte Anwenden dieser Techniken ist unerl&auml;sslich, um gesundheitliche Risiken zu verringern um sich auf die gefesselte&nbsp;Person fokussieren zu k&ouml;nnen.</p>\r\n\r\n<p><strong>Physische Grenzen:</strong><br />\r\nAlle Beteiligten sollten ihre eigenen physischen Grenzen verstehen und respektieren. Dies beinhaltet die F&auml;higkeit, k&ouml;rperliche Beschwerden oder Gesundheitsprobleme zu kommunizieren und auf m&ouml;gliche Warnzeichen zu achten. Physische Grenzen sowie die F&auml;higkeiten diese wahrzunehmen&nbsp;k&ouml;nnen durch den Konsum von Alkohol oder anderen bewusstseinsver&auml;ndernden Substanzen beeintr&auml;chtigt werden. Wir setzen voraus, dass alle Beteiligten an einem Training im vollen Besitz ihrer geistigen und k&ouml;rperlichen Kr&auml;fte teilnehmen.</p>\r\n\r\n<p><strong>Psychische Grenzen:</strong><br />\r\nDie psychische Gesundheit und das emotionale Wohlbefinden der Beteiligten sind ebenfalls von gro&szlig;er Bedeutung. Offene Kommunikation &uuml;ber Vorlieben, Abneigungen, &Auml;ngste und Grenzen ist unerl&auml;sslich. Shibari kann emotionale Reaktionen hervorrufen. Es ist uns wichtig, die emotionalen Bed&uuml;rfnisse und Grenzen der Beteiligten zu ber&uuml;cksichtigen.&nbsp;Wir wollen einen Raum zu schaffen, in dem sich alle Beteiligten sicher f&uuml;hlen, ihre emotionalen Bed&uuml;rfnisse auszudr&uuml;cken und diese Gef&uuml;hle respektiert werden.&nbsp;<br />\r\nVor jeder Shibari-Session ist es unerl&auml;sslich, offene zu kommunizieren und die ausdr&uuml;ckliche Einwilligung aller Beteiligten einzuholen.<br />\r\nDies sollte auch Signale f&uuml;r das Abbrechen oder Anpassen der Aktivit&auml;t einschlie&szlig;en. Mehr Details und unsere Trainingskultur findet Ihr <a href="/konsent">hier</a>.</p>\r\n\r\n<p><strong>Ausbildung durch erfahrene Trainer:innen:</strong><br />\r\nWir glauben, sich von erfahrenen Trainer:innen&nbsp;ausbilden zu lassen, macht einen Unterschied zur&nbsp;autodidaktischen Herangehensweise. Um&nbsp;die Techniken und Sicherheitsaspekte zu erlernen, kontrollieren und korrigieren wir Seilplatzierung, Seilspannung und Ausf&uuml;hrungsgenauigkeit. Dies kann dazu beitragen, das Risiko von Verletzungen zu minimieren und l&auml;sst die Lernenden die Prinzipien der einzelnen Techniken besser verinnerlichen.</p>\r\n','\r',char(13)),'\n',char(10)),'/sicherheit-und-risiken','2023-08-31 15:47:04.992258','2024-02-03 12:43:04.066455',0,0,NULL,5,1,NULL,NULL,NULL,0,NULL,0,75);
INSERT INTO spree_pages VALUES(10,'Konsent','','/konsent','2023-08-31 15:47:18.263711','2024-02-03 12:43:04.066455',0,0,NULL,6,1,NULL,NULL,NULL,0,NULL,0,76);
INSERT INTO spree_pages VALUES(11,'Konsent im Workshop und Training',replace(replace('<h2>Der Konsens&nbsp;im Training / Unsere Trainingskultur</h2>\r\n\r\n<hr />\r\n<p>Ein respektvolles Miteinander und gegenseitige Zustimmung sind essentiell f&uuml;r unsere Trainingskultur.&nbsp;<br />\r\n&nbsp;<br />\r\nUnsere Trainerinnen und Trainer&nbsp;sagen die &Uuml;bungen an und &uuml;berpr&uuml;fen diese, wobei es gelegentlich notwendig sein kann, die gefesselte Person zu ber&uuml;hren, um die Sicherheit und Effektivit&auml;t der &Uuml;bung sicherzustellen.&nbsp;<br />\r\nWenn aus irgendeinem Grund eine &Uuml;bung nicht durchgef&uuml;hrt werden kann, sei es aufgrund einer akuten Verletzung oder aus anderen Gr&uuml;nden, ist es die Verantwortung der Trainierenden, dies den Trainerinnen und Trainer mitzuteilen.&nbsp;<br />\r\n&nbsp;<br />\r\nDie fesselnde Person &uuml;bernimmt die Verantwortung, ihre &Uuml;bungspartner:innen vor dem Training &uuml;ber den Ablauf aufzukl&auml;ren. Sofern es vor dem Training von Euch nicht anders kommuniziert wird, gehen unsere Trainerinnen und Trainer davon aus, dass die gefesselte Person zu Korrekturzwecken von ihnen ber&uuml;hrt werden darf.&nbsp;<br />\r\n&nbsp;<br />\r\nDie gefesselte Person erm&ouml;glicht der fesselnden Person das Training. Daher ist es am Ende eines Trainings &uuml;blich, dass sich die fesselnde Person bei der gefesselten Person bedankt.&nbsp;<br />\r\nEs ist uns wichtig, dass Ihr diese Grunds&auml;tze auch wechselnden Trainingspartner:innen kommuniziert.&nbsp;<br />\r\nIhr k&ouml;nnt neuen Trainingspartner:innen zum Beispiel diese Seite empfehlen. &nbsp;<br />\r\n&nbsp;<br />\r\nDas Training stellt eine besondere Situation dar. Wenn Du allgemeine Informationen &uuml;ber Konsens suchst, klicke&nbsp;<a href="https://dev.kinbaku-berlin.de/konsent">hier</a>.</p>\r\n','\r',char(13)),'\n',char(10)),'/konsent-im-workshop-und-training','2023-08-31 15:47:30.264946','2024-02-03 12:43:04.066455',0,0,NULL,7,1,NULL,NULL,NULL,0,NULL,0,77);
INSERT INTO spree_pages VALUES(14,'Training',replace(replace('<h2>Training</h2>\r\n\r\n<hr />\r\n<p>Wir vermitteln das Wissen &auml;hnlich wie in einem Kampfsportverein. Es gibt mehrere Stufen, die ihr mit der Zeit erreicht k&ouml;nnt. Zun&auml;chst werden Grundlagen vermittelt, z. B.: Einhand-Fesselung, Zweihand-Fesselungen. Danach folgen darauf aufbauende komplexere Fesselungen. Ihr lernen in eurem eigenen Tempo, nicht durch Frontalunterricht. Dabei wird nicht nur auf die Technik geachtet, sondern auch auf die Haltung. Das K&ouml;nnen spiegelt sich also nicht nur im theoretischen Verstehen sondern auch in der praktischen Anwendung wider. Erst wenn eine Technik intensiv verinnerlicht wurde, begleiten wir Euch zum n&auml;chsten Schritt. Der Unterricht im Dojo unterscheidet sich dadurch von Workshop-Konzepten.</p>\r\n\r\n<p>Ziel ist es, &uuml;ber Regelm&auml;&szlig;igkeit und konstante Wiederholungen eine Routine der Seilf&uuml;hrung zu erreichen, die es erlaubt den Partner schnell, effizient und mit gr&ouml;&szlig;tm&ouml;glicher Sicherheit einzufangen. Hierf&uuml;r werden den Lernenden grundlegende Kenntnisse in Anatomie und Physiologie vermittelt. Durch gezielte Wiederholung einzelner &Uuml;bungen entsteht Routine, die in Gefahrensituationen Ruhe und Sicherheit gibt. Durch diese Art des Trainings weird das Muskelged&auml;chtnis geschult, was eine m&ouml;glichst hohe Wiederholbarkeit und dadurch Sicherheit gew&auml;hrleistet und Risiken minimiert.</p>\r\n\r\n<p>Die Teilnahme am Training ist nur als Paar m&ouml;glich, ihr braucht also jemanden, der euch begleitet.</p>\r\n\r\n<p>Jede Person, die aktiv bei uns fesseln lernen m&ouml;chte, muss einmalig unsere Einf&uuml;hrungsveranstaltung besuchen. Hier bekommt ihr alle Infos, die ihr f&uuml;r das Training bei uns ben&ouml;tigt sowie einen Eindruck von unserem Unterricht. Anschlie&szlig;end seid k&ouml;nnt ihr an jedem Grundstufentraining teilnehmen.</p>\r\n','\r',char(13)),'\n',char(10)),'/training-und-workshops','2023-05-16 19:44:38.795541','2024-02-03 12:43:04.066455',0,0,NULL,9,1,NULL,NULL,NULL,0,NULL,0,5);
INSERT INTO spree_pages VALUES(15,'Lerninhalte',replace(replace('<p><strong>Training ab Grundstufe&nbsp;</strong>(Kyu 9-7)</p>\r\n\r\n<hr />\r\n<p>Unsere Grundstufe bietet eine solide Basis f&uuml;r die praktische Anwendung des Fesselns. Hier sind einige der Lerninhalte, die dich in diesem Training erwarten:</p>\r\n\r\n<p><strong>Umgang mit dem Seil</strong><br />\r\nWir beginnen mit den Grundlagen und vermitteln dir, wie du das Seil sicher und effektiv handhabst. Von der richtigen Seilauswahl bis hin zur Pflege lernst du alles, was du wissen musst.</p>\r\n\r\n<p><strong>Basishandgriffe verinnerlichen</strong><br />\r\nDu wirst grundlegende Fesseltechniken erlernen und &uuml;ben, um die Basishandgriffe zu beherrschen. Diese bilden das Fundament f&uuml;r weiterf&uuml;hrende Techniken.</p>\r\n\r\n<p><strong>Einf&uuml;hrung in Semi-Suspension</strong><br />\r\nWir f&uuml;hren dich in die aufregende Welt der Semi-Suspension ein, bei der die gefesselte Person teilweise vom Boden abgehoben wird. Hier lernst du die notwendigen Schritte und Sicherheitsma&szlig;nahmen.</p>\r\n\r\n<p><strong>Einf&uuml;hrung in japanische &Auml;sthetik</strong><br />\r\nWir teilen mit dir die Sch&ouml;nheit und Eleganz der japanischen Fesselkunst. Die &Auml;sthetik spielt eine wichtige Rolle, und du wirst verstehen, wie sie in die Praxis einflie&szlig;t.</p>\r\n\r\n<p><strong>Einf&uuml;hrung in unterschiedliche Fesselintentionen</strong><br />\r\nFesseln kann viele verschiedene Absichten haben, von der Intimit&auml;t bis zur Meditation. Wir zeigen dir die Vielfalt der Fesselintentionen und wie du sie umsetzen kannst.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Training ab Mittelstufe</strong> (Kyu 6-4)</p>\r\n\r\n<p>In der Mittelstufe tauchst du tiefer in die Welt des Fesselns ein und erweiterst deine F&auml;higkeiten. Die Fesselungen werden komplexer:</p>\r\n\r\n<p><strong>Erweiterung von Basisfesselungen</strong><br />\r\nWir bauen auf den Grundlagen aus der Grundstufe auf und zeigen dir fortgeschrittenere Techniken zur Erweiterung von Basisfesselungen. Du wirst lernen, wie du Variationen und Verfeinerungen hinzuf&uuml;gst.</p>\r\n\r\n<p><strong>Sicherer Umgang mit Suspensions</strong><br />\r\nIn der Mittelstufe vertiefst du dein Verst&auml;ndnis f&uuml;r das Aufh&auml;ngen von gefesselten Personen. Wir vermitteln dir die notwendigen Kenntnisse und F&auml;higkeiten, um Suspensions sicher durchzuf&uuml;hren.</p>\r\n\r\n<p><strong>Sicherer Umgang mit Progressionen in Suspensions</strong><br />\r\nWir gehen einen Schritt weiter und zeigen dir, wie du Progressionen in Suspensions sicher umsetzt. Dies erm&ouml;glicht dir, komplexere und faszinierende Techniken zu beherrschen.</p>\r\n\r\n<p><strong>Einf&uuml;hrung von Transitions in Suspensions</strong><br />\r\nTransitions sind flie&szlig;ende &Uuml;berg&auml;nge zwischen verschiedenen Fesselpositionen. In der Mittelstufe wirst du lernen, wie du diese eleganten &Uuml;berg&auml;nge in Suspensions integrierst.</p>\r\n\r\n<p>Unsere Mittelstufe bringt dich auf die n&auml;chste Stufe deiner Fesselkunst-Reise. Du wirst deine F&auml;higkeiten erweitern.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Training f&uuml;r Fortgeschrittene</strong> (Kyu 3-1)</p>\r\n\r\n<p>Im Training f&uuml;r Fortgeschrittene verfeinerst Du, aufbauend auf Deinen bisher erworbenen Fertigkeiten, Deine Fesseltechniken.</p>\r\n\r\n<p><strong>Komplexere Fesselungen</strong><br />\r\nDu wirst dich mit fortschrittlichen und anspruchsvolleren Fesseltechniken vertraut machen, um deine Fertigkeiten zu erweitern.</p>\r\n\r\n<p><strong>Vertiefung der Fesselintentionen</strong><br />\r\nWir bieten intensivere Einblicke in die verschiedenen Fesselintentionen, um dir ein tieferes Verst&auml;ndnis f&uuml;r ihre praktische Anwendung zu vermitteln.</p>\r\n\r\n<p><strong>Wiederholung aller Basisfesselungen zur Festigung</strong><br />\r\nDie Grundlagen sind entscheidend, daher werden wir alle Basisfesselungen erneut durchgehen, um sicherzustellen, dass du ein solides Fundament f&uuml;r fortgeschrittene Techniken hast.</p>\r\n\r\n<p>Unsere Fortgeschrittenen-Trainingsstufe fordert dich heraus, deine Fertigkeiten zu verfeinern und neue Herausforderungen zu meistern.</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pr&uuml;fungen</strong><br />\r\n<br />\r\nIn unserem Ausbildungskonzept schlie&szlig;en alle Level mit einer abschlie&szlig;enden Pr&uuml;fung ab. Doch diese Pr&uuml;fungen sind mehr als nur formale Tests &ndash; sie sind bewusst gestaltete Stresssituationen. Bis zum fortgeschrittenen Level setzen wir unsere Sch&uuml;lerinnen und Sch&uuml;ler gezielt unter Zeitdruck. Warum? Weil wir ihnen zeigen m&ouml;chten, dass sie die erworbenen Techniken auch unter Druck souver&auml;n anwenden k&ouml;nnen.</p>\r\n\r\n<p>Diese&nbsp;Pr&uuml;fungen dienen einem wichtigen Zweck: sie st&auml;rken nicht nur das K&ouml;nnen, sondern auch das Selbstbewusstsein. Jeder erfolgreiche Abschluss signalisiert, dass man bereit ist, den n&auml;chsten Schritt zu gehen und neue Herausforderungen anzunehmen. Dies ist ein wesentlicher Bestandteil unserer Lehrmethode und bereitet unsere Mitglieder.<br />\r\n<br />\r\nTrainiert wird Kyu-&uuml;bergreifend, zum Beispiel &#39;ab Grundstufe&#39;, &#39;ab Mittelstufe&#39;. Gepr&uuml;ft wird immer nur jeweils eine der Kyu-Stufen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','\r',char(13)),'\n',char(10)),'/lerninhalte','2023-05-16 19:45:06.343004','2024-02-03 12:43:04.066455',0,0,NULL,10,1,NULL,NULL,NULL,0,NULL,0,79);
INSERT INTO spree_pages VALUES(17,'Workshop',replace(replace('<h2>Workshops</h2>\r\n\r\n<hr />\r\n<p>Zu unseren Workshops begr&uuml;&szlig;en wir alle, die neugierig sind und Neues erlernen oder vertiefen m&ouml;chten.</p>\r\n\r\n<p>Zu den Workshops z&auml;hlt auch unsere&nbsp;Einf&uuml;hrungsveranstaltung, die f&uuml;r alle Teilnehmenden&nbsp;Pflicht ist, die im regul&auml;ren Training durchzustarten wollen. Hier erwarten dich nicht nur die Basics, sondern auch die Gemeinschaft, die uns auszeichnet.<br />\r\nDu findest die Einf&uuml;hrungsveranstaltung <a href="http://dev.kinbaku-berlin.de/einfuehrungsveranstaltung">hier</a>.</p>\r\n\r\n<p>Unsere Workshops sind vielseitig und finden unregelm&auml;&szlig;ig statt. Du findest die ausf&uuml;hrliche Beschreibungen hier und kannst dann&nbsp;auch direkt im Shop online buchen.<br />\r\nVon Sicherheit bis hin zu speziellen Praktiken &ndash; unsere Workshops decken viele Themen ab und wecken Deine Neugier.</p>\r\n\r\n<p>Die Teilnahme an Workshops ist f&uuml;r unsere Vereinsmitglieder verg&uuml;nstigt.</p>\r\n\r\n<p>Die Workshops werden von unseren erfahrenen Vereinstrainer:innen&nbsp;sowie Gastdozierenden geleitet, die ihr umfangreiches Wissen und ihre Leidenschaft mit dir teilen. Dies ist Deine Chance, in eine riesige Welt spannenden Wissens einzutauchen und neue F&auml;higkeiten zu erlernen.</p>\r\n\r\n<p>Komm vorbei und dehne Deinen Horizont aus &ndash; wir freuen uns auf Dich!<br />\r\n&nbsp;</p>\r\n','\r',char(13)),'\n',char(10)),'/workshop','2023-05-16 19:45:39.732608','2024-02-03 12:43:04.066455',0,0,NULL,11,1,NULL,NULL,NULL,0,NULL,0,81);
INSERT INTO spree_pages VALUES(18,'Einzelunterricht',replace(replace('<h2>Einzelunterricht</h2>\r\n\r\n<hr />\r\n<p>Auch Einzelunterricht k&ouml;nnt Ihr bei uns buchen. Ob als Berlinbesuchende, aus zeitlichen Gr&uuml;nden oder weil Ihr andere Inhalte als im Training vertiefen m&ouml;chtet, k&ouml;nnte der Einzelunterricht f&uuml;r Euch interessant sein.&nbsp;<br />\r\n&nbsp;<br />\r\nF&uuml;r die Unterrichtseinheiten (60 Minuten) des Einzelunterrichts gelten Pauschalpreise:&nbsp;<br />\r\nEine Unterrichtseinheit liegt bei 70 &euro;.&nbsp;<br />\r\nDrei Unterrichtseinheiten liegen bei 150 &euro;.&nbsp;<br />\r\n&nbsp;<br />\r\nDen Unterricht k&ouml;nnt Ihr Euch bei Bedarf mit bis zu zwei weiteren Paaren teilen. Der Preis &auml;ndert sich dadurch nicht.&nbsp;<br />\r\nIn Absprache k&ouml;nnen wir individuelle Lernziele nach Euren W&uuml;nschen definieren.&nbsp;<br />\r\n&nbsp;<br />\r\nDer Einzelunterricht wird in der Regel in 3h-Bl&ouml;cken absolviert mit einer Pause dazwischen, z.B. Samstag + Sonntags Vor- und Nachmittag je 3std Unterricht. Dazwischen ist Zeit um Gelerntes sacken zu lassen, zu wiederholen, oder einfach nur zum Essen und Entspannen. &nbsp;<br />\r\n&nbsp;<br />\r\nSchickt uns gerne eine Mail mit Euren Vorstellungen und wir besprechen, was m&ouml;glich ist.</p>\r\n','\r',char(13)),'\n',char(10)),'/einzelunterricht','2023-05-16 19:51:03.307187','2024-02-03 12:43:04.066455',0,0,NULL,12,1,NULL,NULL,NULL,0,NULL,0,82);
INSERT INTO spree_pages VALUES(19,'Galerie',replace(replace('<p>Hier entsteht eine Galerie</p>\r\n','\r',char(13)),'\n',char(10)),'/gallerie','2023-05-16 21:02:11.097861','2024-02-03 12:43:04.066455',0,0,NULL,13,1,NULL,NULL,NULL,0,NULL,0,7);
INSERT INTO spree_pages VALUES(20,'Einführungsveranstaltung',replace(replace('<h2>Die Einf&uuml;hrungsveranstaltung</h2>\r\n\r\n<hr />\r\n<p><br />\r\nDie Einf&uuml;hrungsveranstaltung dient als Grundlage f&uuml;r den Unterricht im Kinbaku Dojo Berlin, kann aber auch eigenst&auml;ndig als Workshop f&uuml;r Fesselinteressierte wahrgenommen werden. Durch die Einf&uuml;hrungsveranstaltung wollen wir sicherstellen, dass alle, die bei uns unterrichtet werden, &uuml;ber sicherheitsrelevante Aspekte Informiert sind, aber auch vereinsinterne Regelungen kennen. Dies nimmt vorab etwas Zeit in Anspruch, daher gliedern wir die Einf&uuml;hrungsveranstaltung vom w&ouml;chentlichen Training ab. Die Einf&uuml;hrungsveranstaltung ist die Voraussetzung um bei unserem Grundstufen Training teilnehmen zu k&ouml;nnen.<br />\r\n<br />\r\nDie Einf&uuml;hrungsveranstaltung wird &uuml;berwiegend frontal unterrichtet und unterscheidet sich daher sehr von dem gew&ouml;hnlichen Training. Daher nehmen wir uns etwas mehr Zeit - wir machen kurze Pausen - bringt Euch also gern einem Snack mit.<br />\r\n<br />\r\nWir starten mit einem theoretischen Teil<br />\r\n<br />\r\n- &Uuml;berblick: Sicherheit und Consent<br />\r\n- &Uuml;berblick: Materialkunde<br />\r\n- &Uuml;berblick: Medizinische Themen<br />\r\n- Informationen &uuml;ber den Verein<br />\r\n- Informationen zu Trainingsmethoden<br />\r\n- Informationen zu unserem Pr&uuml;fungssystem<br />\r\n<br />\r\nDann legen wir mit der Praxis los.<br />\r\n<br />\r\n- Praxisteil: Ihr lernt Elemente der ersten Stufe (Kyu9) in unserem Schulsystem kennen. Wir empfehlen diese Techniken in unseren Trainingsstunden zu vertiefen.<br />\r\n<br />\r\n- Demoteil. Kurze Demo, wie man die gelernten Elemente einsetzten k&ouml;nnte<br />\r\n<br />\r\nDer Workshop soll einen &Uuml;berblick verschaffen und f&uuml;r die Trainingsstunden vorbereiten. Im Training werden sp&auml;ter die Lerninhalte vertieft.</p>\r\n','\r',char(13)),'\n',char(10)),'/einfuehrungsveranstaltung','2023-05-16 21:09:37.210451','2024-02-03 12:43:04.066455',0,0,NULL,8,1,NULL,NULL,NULL,0,NULL,0,78);
INSERT INTO spree_pages VALUES(21,'Infos',replace(replace('<p><strong>Was ist eigentlich Shibari? oder Alles rund um Shibari</strong></p>\r\n\r\n<hr />\r\n<p>Diese Seite h&auml;tte aktuell keine weitere Aufgabe.</p>\r\n\r\n<p>Hier k&ouml;nnte die zentrale Frage beantwortet werden: was ist Shibari, warum, woher, wieso, wie, von Geschichte bis Schulen.</p>\r\n\r\n<p>Hier k&ouml;nnten zun&auml;chst die Themen im Men&uuml; Info&nbsp;klickbar in Form von Bild/Text-Kombination verlinkt werden.</p>\r\n','\r',char(13)),'\n',char(10)),'/infos','2023-09-24 17:36:41.301876','2024-02-03 12:43:04.066455',0,0,NULL,2,1,NULL,NULL,NULL,0,NULL,0,4);
INSERT INTO spree_pages VALUES(22,'Aktivitäten',replace(replace('<p><strong><em>Aktivit&auml;ten</em></strong></p>\r\n\r\n<hr />\r\n<ul>\r\n	<li>J&auml;hrliche Nikolausfeier</li>\r\n	<li>Betreibung der Shibari Lounge auf dem Xplore Festival Berlin seit 2014</li>\r\n	<li>Besuch der Performance Abende auf der Eurix im Fr&uuml;hling und Herbst</li>\r\n</ul>\r\n','\r',char(13)),'\n',char(10)),'/aktivitaeten','2023-11-16 11:22:42.610240','2024-02-03 12:43:04.066455',0,0,NULL,14,1,NULL,NULL,NULL,0,NULL,0,84);
INSERT INTO spree_pages VALUES(23,'Impressum',replace(replace('<p><br />\r\nOsada Kinbaku Dojo e.V.<br />\r\nBinzstra&szlig;e 64<br />\r\n13189 Berlin-Pankow</p>\r\n\r\n<p>Vertreten durch:<br />\r\nVorstandsvorsitzende(r): Holger Pitzner<br />\r\nstellv. Vorstandsvorsitzende(r): Alexander Esser</p>\r\n\r\n<p>Kontakt:<br />\r\nE-Mail: <span class="marker"><strong>info@kinbaku-berlin.de</strong></span></p>\r\n\r\n<p>Vereinsregister:<br />\r\nRegisternummer: VR 29488 B</p>\r\n\r\n<p>Umsatzsteuer-Identifikationsnummer:<br />\r\nGem&auml;&szlig; &sect; 27 a Umsatzsteuergesetz: <strong><span class="marker">DE123456789</span></strong></p>\r\n\r\n<p>Verantwortlich f&uuml;r den Inhalt nach &sect; 55 Abs. 2 RStV:<br />\r\nMax&nbsp;<br />\r\nstra&szlig;e123<br />\r\n12345 Musterstadt</p>\r\n\r\n<p>Haftungshinweis:<br />\r\nTrotz sorgf&auml;ltiger inhaltlicher Kontrolle &uuml;bernehmen wir keine Haftung f&uuml;r die Inhalte externer Links.<br />\r\nF&uuml;r den Inhalt der verlinkten Seiten sind ausschlie&szlig;lich deren Betreiber verantwortlich.</p>\r\n\r\n<p>Datenschutzerkl&auml;rung:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span class="marker"><strong>Shop-AGB - ENTWURF -</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Allgemeine Gesch&auml;ftsbedingungen (AGB) f&uuml;r den Webshop von Shibari Dojo Berlin e.V.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Geltungsbereich:</strong> Diese Allgemeinen Gesch&auml;ftsbedingungen gelten f&uuml;r s&auml;mtliche Angebote, Vertr&auml;ge und Lieferungen zwischen dem Shibari Dojo Berlin e.V. (nachfolgend &quot;Veranstalter&quot; genannt) und den Teilnehmer:innen an Workshops und Trainings (nachfolgend &quot;Lehrstunden&quot; genannt), die au&szlig;erhalb jedweder Mitgliedschaften stattfinden.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Anmeldung und Vertragsabschluss:</strong> Die Anmeldung zu Lehrstunden erfolgt &uuml;ber den Webshop des Veranstalters. Der Vertrag kommt zustande, sobald die Teilnehmer:innen die Anmeldung best&auml;tigen&nbsp;und die Teilnahmegeb&uuml;hr entrichtet haben.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Teilnahmegeb&uuml;hr und Zahlung:</strong> Die Teilnahmegeb&uuml;hr ist vor dem Workshop/der Lehrstunde zu entrichten. Bei Zahlungsverzug beh&auml;lt sich der Veranstalter das Recht vor, die Teilnahme zu verweigern.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Stornierung:</strong> Stornierungen sind bis sp&auml;testens 24 Stunden Beginn der Lehrstunde kostenfrei m&ouml;glich. R&uuml;ckerstattungen sind nicht m&ouml;glich. Gutschriften k&ouml;nnen innerhalb von 4 Wochen f&uuml;r Lehrstunden eingel&ouml;st werden. In besonderen und H&auml;rtef&auml;llen finden beide Parteien eine einvernehmliche L&ouml;sung. Bei Nichterscheinen ohne rechtzeitige Absage wird die Teilnahmegeb&uuml;hr f&auml;llig, es sei denn, Teilnehmer:innen waren aufgrund von Krankheit oder h&ouml;herer Gewalt verhindert.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Kapazit&auml;t und &Uuml;bertragbarkeit:</strong> Die Teilnehmer:innenzahl ist begrenzt. Es besteht kein Anspruch auf freie Pl&auml;tze, wenn die maximale Teilnehmer:innenzahl erreicht ist. In einem solchen Fall ist es nicht mehr m&ouml;glich eine Teilnahmeberechtigung zu erwerben. Die Teilnahmeberechtigung&nbsp;ist &uuml;bertragbar.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Leistungserbringung:</strong> Die Leistung gilt als erbracht, wenn die Lehrstunde stattgefunden hat, unabh&auml;ngig davon, ob die Teilnehmer:innen die gesamte Zeit daran teilgenommen haben oder nicht erschienen sind.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Einfl&uuml;sse durch externe Umst&auml;nde:</strong> Bei Einfl&uuml;ssen durch Krankheit oder h&ouml;here Gewalt wird einvernehmlich ein Ersatztermin f&uuml;r die Teilnahme gefunden. Der Veranstalter beh&auml;lt sich das Recht vor, die Lehrstunde aus wichtigem Grund abzusagen und einen Ersatztermin anzubieten.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>&Auml;nderungen und Absagen:</strong> Der Veranstalter beh&auml;lt sich das Recht vor, die Lehrstunde aus organisatorischen Gr&uuml;nden abzusagen oder zu verschieben. In diesem Fall wird ein Ersatztermin angeboten oder die Teilnahmegeb&uuml;hr erstattet.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Haftung:</strong> Der Veranstalter haftet nur f&uuml;r Vorsatz und grobe Fahrl&auml;ssigkeit. Die Teilnahme erfolgt auf eigene Gefahr.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Schlussbestimmungen:</strong> Es gilt das Recht der Bundesrepublik Deutschland. Gerichtsstand ist der Sitz des Veranstalters (Amtsgericht <strong><span class="marker">????</span></strong>). Sollte eine Bestimmung dieser AGB unwirksam sein, bleibt die Wirksamkeit der &uuml;brigen Bestimmungen unber&uuml;hrt.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Berlin, 2024</p>\r\n\r\n<p>Shibari Dojo Berlin e.V.</p>\r\n','\r',char(13)),'\n',char(10)),'/impressum','2023-11-16 16:59:06.355932','2024-02-03 17:10:25.169061',0,0,NULL,15,1,NULL,NULL,NULL,0,NULL,0,85);
