INSERT INTO spree_content_blocks VALUES(33,10,'richtext','',replace(replace('<h2>Konsent</h2>\r\n\r\n<hr />\r\n<p>Es ist wichtig, dass alle Beteiligten jederzeit freiwillig und bewusst ihre Zustimmung geben und dass die Grenzen und W&uuml;nsche von allen respektiert werden. Im Osada Kinbaku Dojo e.V. legen wir gro&szlig;en Wert auf die Bedeutung von Konsent, um eine sichere und positive Erfahrung f&uuml;r alle Beteiligten zu gew&auml;hrleisten.&nbsp;</p>\r\n\r\n<p>Das Konzept des &quot;Wheel of Consent&quot; nach Betty Martin ist ein wichtiger Bestandteil unseres Ansatzes, um sicherzustellen, dass alle Handlungen einvernehmlich erfolgen und die W&uuml;nsche und Grenzen aller Beteiligten individuell respektiert werden.</p>\r\n\r\n<p>Das Rad besteht aus vier Quadranten:&nbsp;<br />\r\nDienen, Nehmen, Erlauben und Annehmen&nbsp;<br />\r\n&nbsp;<br />\r\nDiese Aspekte helfen, die verschiedenen Zustimmungsdynamiken zwischen zwei oder mehreren Personen zu verstehen. Der Fokus des Wheels of Consent liegt darauf, dass jeder Einzelne bewusst entscheidet, was er oder sie geben und empfangen m&ouml;chte, und dass dies klar kommuniziert wird.<br />\r\n<br />\r\nKostenloses Infomaterial zum Wheel of Consent findet ihr auf der Seite von Betty Martin: <a href="https://bettymartin.org/wp-content/uploads/2020/10/German.pdf" target="_blank">Wheel of Consent</a></p>\r\n\r\n<p>Es ist trotzdem wichtig zu beachten, dass alles Wissen und Lernen auch hier dem Minimieren der Risiken dient. Das Risiko eines Konsent-Unfall, damit meinen wir das unbewusste und nicht beabsichtigte &Uuml;bertreten einer Grenze, kann wie bei den physischen Unf&auml;llen, nur sehr schwer komplett vermieden werden.<br />\r\nHier ist es wichtig, einen wohlwollenden Umgang miteinander zu pflegen, Verantwortung zu &uuml;bernehmen und Reflektion zuzulassen. In Einzelf&auml;llen kann es sinnvoll sein, eine*n Mediator*in einzuschalten. Falls ihr ein Anliegen habt, scheut euch nicht, uns anzusprechen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Eine Person ohne deren Zustimmung zu fesseln oder Handlungen vorzunehmen, zu denen sie nicht zugestimmt hat, stellt einen Straftatbestand dar.&nbsp;<br />\r\nUnd auch wenn dies in der Umkehrung nicht auf aktiv fesselnde&nbsp;Personen zutrifft,&nbsp;sind dennoch auch deren Grenzen klar zu achten.</p>\r\n\r\n<p>&nbsp;</p>\r\n','\r',char(13)),'\n',char(10)),1,270,'2023-11-16 13:51:02.531552','2023-11-16 17:53:12.340904',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(34,1,'three_squares','Vereins Trenner 1',NULL,1,40,'2023-11-16 16:53:13.934495','2024-02-03 12:52:33.680927',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(36,7,'richtext','',replace(replace('<p><strong>Ben&ouml;tige ich Vorkenntnisse?</strong><br />\r\nDu ben&ouml;tigst keine Vorkenntnisse, da nach der Didaktik erst die Grundlagen vermittelt und gepr&uuml;ft werden, bevor es an komplexere Fesselungen geht</p>\r\n\r\n<p><strong>Sportliche Bekleidung</strong><br />\r\nAllgemein kann man sagen, dass wir ein Sportverein sind. Daher trainieren wir in sportlicher Kleidung ohne Schuhe. Trainiert wird Barfu&szlig; oder in Socken.<br />\r\nWir bitten Euch auf Stra&szlig;enkleidung zu verzichten. Kommt in bequemer sportlicher Kleidung, idealerweise enganliegend.&nbsp;T-Shirt und Hose sind bestens geeignet.<br />\r\nZu weite Kleidung, Kn&ouml;pfe oder B&uuml;gel-BHs k&ouml;nnen Druckstellen verursachen, und k&ouml;nnten im schlimmsten Fall sogar zu Verletzungen f&uuml;hren. Beliebt sind daher Sporthosen ohne Druckkn&ouml;pfe oder Rei&szlig;verschl&uuml;sse, Leggins, Strumpfhosen, Tops oder T-Shirts. Ihr k&ouml;nnt Euch bei uns vor Ort umzuziehen. Am Ende des Trainings wird ohnehin alles voller Fusseln sein.&nbsp;</p>\r\n\r\n<p>Kommt Ihr zu einem Workshop kann die gew&uuml;nschte Bekleidung anders sein, je nach Thema und ob der Workshop theoretisch oder praktisch ist. In der jeweiligen Workshop-Beschreibung findet Ihr auch Details, auch ob Ihr Euch zu Zweit oder als Einzelperson anmelden m&uuml;sst.</p>\r\n\r\n<p><strong>Wird auf mich individuell eingegangen?</strong><br />\r\nEs ist Gruppenunterricht, aber alle lernen in ihrem eigenen Tempo. Unterschiedliche Level trainieren nebeneinander. Unsere Trainerinnen und Trainer korrigieren in&nbsp;1 zu 1&nbsp;Situationen, geben Tipps zu Technik und K&ouml;rperhaltung und Wiederholen die Elemente mit Dir oder zeigen den n&auml;chsten Schritt.</p>\r\n\r\n<p><strong>Ich habe noch keine eigenen Seile, welche Seile eigenen sich f&uuml;r Bondage?</strong><br />\r\nDu kannst Dir anfangs Seile von uns leihen. Wir fesseln ausschlie&szlig;lich mit Jute (oder Hanfseilen). Diese m&uuml;ssen jedoch vorher aufw&auml;ndig bearbeitet werden.</p>\r\n\r\n<p>Es ist sinnvoll, dass Du verschiedene Seile in die Hand nimmst, bevor Du eine Kaufentscheidung triffst. Im Training kannst Du viele verschiedene Seiltypen sehen und andere Sch&uuml;ler:innen&nbsp;fragen, ob Du ihre Seile einmal ausprobieren kannst. Verschiedene Personen haben unterschiedliche Vorlieben was das richtige Seil betrifft und k&ouml;nnen Dir Tipps geben.</p>\r\n\r\n<p><strong>Kann ich mir eine Flasche Wasser zum Training mitbringen?</strong><br />\r\nDu solltest Dein eigenes&nbsp;Getr&auml;nk in einen&nbsp;wiederverschlie&szlig;baren Flasche&nbsp;und&nbsp;auch etwas zu&nbsp;Essen mitbringen. Wir verkaufen keine Getr&auml;nke.</p>\r\n\r\n<p><strong>Was passiert wenn ich kurzfristig (aus wichtigen Gr&uuml;nden) absagen muss?</strong><br />\r\nNat&uuml;rlich kannst du absagen, aber es w&auml;re dann auch gut, wenn du das rechtzeitig machst.&nbsp;Um Dir Kosten zu ersparen, versuchen wir die frei werdenden Pl&auml;tze&nbsp;aufzuf&uuml;llen.<br />\r\nTrainings finden in Mietr&auml;umen statt. Daher bitten wir um Dein Verst&auml;ndnis, dass wir bei kurzfristiger Absage keine R&uuml;ckerstattung erm&ouml;glichen k&ouml;nnen.<br />\r\nBitte halte eine Frist von mindestens 24h f&uuml;r eine Absage ein.<br />\r\nBei Workshops kann sich das ein wenig anders gestalten.</p>\r\n','\r',char(13)),'\n',char(10)),1,50,'2023-11-16 17:24:10.608414','2023-11-16 18:06:36.432246',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
